import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Register.css'
import axios from 'axios';

const Register = () => {
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        username: '',
        email: '',
        password: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        app.post('/api/register', async (req, res) => {
            const { firstName, lastName, username, email, password } = req.body;

            const userRegisteredSuccessfully = await registerUser(firstName, lastName, username, email, password);

            if (userRegisteredSuccessfully) {
                res.status(201).json({ message: 'Usuário registrado com sucesso!' });
            } else {
                res.status(400).json({ message: 'Erro ao registrar usuário!' });
            }
        });

        try {
            const response = await axios.post('/server/routes/users', {
                firstName,
                lastName,
                username,
                email,
                password,
            });

            if (response.status === 201) {
                // Redirecionar para a tela de login
                window.location.href = '/login';
            } else {
                alert('Erro ao registrar usuário!');
            }
        } catch (error) {
            console.error(error);
            alert('Erro ao registrar usuário!');
        }
    };

    return (
        <div className="register-container">
            <h1>Registro</h1>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    name="firstName"
                    placeholder="Primeiro nome"
                    value={formData.firstName}
                    onChange={handleChange}
                />
                <input
                    type="text"
                    name="lastName"
                    placeholder="Sobrenome"
                    value={formData.lastName}
                    onChange={handleChange}
                />
                <input
                    type="text"
                    name="username"
                    placeholder="Nome de usuário"
                    value={formData.username}
                    onChange={handleChange}
                />
                <input
                    type="email"
                    name="email"
                    placeholder="E-mail"
                    value={formData.email}
                    onChange={handleChange}
                />
                <input
                    type="password"
                    name="password"
                    placeholder="Senha"
                    value={formData.password}
                    onChange={handleChange}
                />
                <button type="submit">Registrar</button>
            </form>
            <p>
                Já possui uma conta? <Link to="/login">Faça login aqui</Link>
            </p>
        </div>
    );
};

export default Register;
